import{_ as r,C as e,c as n,o,a2 as c,G as i}from"./chunks/framework.CPU0zDjs.js";const d="/assets/faq-screen/463052615-ca13a991-4e8a-4c0d-b98e-67be36845a79.webp",h="/assets/faq-screen/463053323-ea51c143-12da-4c7a-9c5e-8f18bc54b673.webp",b="/assets/faq-screen/463052225-26c603e7-0ef2-4664-903a-11a366720449.webp",p="/assets/faq-screen/463052051-68e96fb7-38e1-465f-bb7e-2ab6f0c5c942.webp",u="/assets/faq-screen/463051728-7b560c32-8831-4dcc-b313-eb4be55f86c9.webp",f="/assets/faq-screen/463047579-2ab88016-4efa-4bab-90aa-d952e83f5ed8.webp",t="/assets/faq-screen/463047395-5d0d1e7c-14a4-43fb-b240-2299bcb4cf45.webp",C=JSON.parse('{"title":"界面与启动排障","description":"解决LingChat界面显示问题和启动问题，包括加载问题、端口占用问题和浏览器兼容性问题。","frontmatter":{"title":"界面与启动排障","description":"解决LingChat界面显示问题和启动问题，包括加载问题、端口占用问题和浏览器兼容性问题。"},"headers":[],"relativePath":"faq/ui/index.md","filePath":"faq/ui/index.md","lastUpdated":1758397661000}'),m={name:"faq/ui/index.md"};function q(_,a,k,g,x,P){const l=e("NolebaseGitContributors"),s=e("NolebaseGitChangelog");return o(),n("div",null,[a[0]||(a[0]=c('<h1 id="🔳界面与启动排障" tabindex="-1">🔳界面与启动排障 <a class="header-anchor" href="#🔳界面与启动排障" aria-label="Permalink to &quot;🔳界面与启动排障&quot;">​</a></h1><p>本板块收录 LingChat 启动、界面、端口等相关常见问题及解决方法。</p><h2 id="启动问题" tabindex="-1">启动问题 <a class="header-anchor" href="#启动问题" aria-label="Permalink to &quot;启动问题&quot;">​</a></h2><h3 id="lingchat-启动半天都在转圈圈" tabindex="-1">Lingchat 启动半天都在转圈圈 <a class="header-anchor" href="#lingchat-启动半天都在转圈圈" aria-label="Permalink to &quot;Lingchat 启动半天都在转圈圈&quot;">​</a></h3><p><img src="'+d+'" alt="3c06ff9da6aa261ba2855d0c512f656e"></p><ul><li>多等一会，初始化时间比较长，在此期间不要关闭，如果最后还是无法启动，那没救了（，你的电脑可能是 20 多年前的老古董</li></ul><h3 id="通常每个套接字地址-地址-网络地址-端口-只允许使用一次" tabindex="-1">通常每个套接字地址(地址/网络地址/端口)只允许使用一次 <a class="header-anchor" href="#通常每个套接字地址-地址-网络地址-端口-只允许使用一次" aria-label="Permalink to &quot;通常每个套接字地址(地址/网络地址/端口)只允许使用一次&quot;">​</a></h3><p><img src="'+h+'" alt="image"></p><ul><li>可能你的上一个 Lingchat 没有关闭，或者有其他从程序占用了 8765 这个端口，你可以检查是哪个程序占用的，把它那个程序给关了（或者使用重启大法）</li></ul><h2 id="对话问题" tabindex="-1">对话问题 <a class="header-anchor" href="#对话问题" aria-label="Permalink to &quot;对话问题&quot;">​</a></h2><h3 id="提示-402-错误-your-api-key-is-invalid" tabindex="-1">提示 402 错误: Your api key is invalid <a class="header-anchor" href="#提示-402-错误-your-api-key-is-invalid" aria-label="Permalink to &quot;提示 402 错误: Your api key is invalid&quot;">​</a></h3><p><img src="'+b+'" alt="9049a8c0adc590f56717b4fec3f705f6"></p><ul><li>翻译：你的 API 无效，检查设置里有没有改过秘钥</li><li>检查是否 API KEY 和 URL 是对应的，硅基流动的秘钥不能给 deepseek 用之类的</li></ul><h3 id="提示-402-错误-insuffient-balance" tabindex="-1">提示 402 错误：Insuffient Balance <a class="header-anchor" href="#提示-402-错误-insuffient-balance" aria-label="Permalink to &quot;提示 402 错误：Insuffient Balance&quot;">​</a></h3><p><img src="'+p+'" alt="36424a8d6fc3b28ae50e004a1ef31356"></p><ul><li>翻译：你没有余额，假如你用 deepseek，要先充值</li></ul><h2 id="simple-vits-api-语音问题" tabindex="-1">Simple Vits API 语音问题 <a class="header-anchor" href="#simple-vits-api-语音问题" aria-label="Permalink to &quot;Simple Vits API 语音问题&quot;">​</a></h2><h3 id="启动提示-py-有问题" tabindex="-1">启动提示 py 有问题 <a class="header-anchor" href="#启动提示-py-有问题" aria-label="Permalink to &quot;启动提示 py 有问题&quot;">​</a></h3><p><img src="'+u+'" alt="2da141f2e7c7e654c979ccbbde19d5d6"></p><ul><li>如果你在解压的时候遇到了错误提示，则软件是无法打开的，推荐使用 Bandzip 解压软件，无广告而且比原版 windows 好用多了。然后使用 Bandzip 解压，无错误则成功</li></ul><h3 id="vits-卡住-提示-connection-拒绝" tabindex="-1">Vits 卡住，提示 Connection 拒绝 <a class="header-anchor" href="#vits-卡住-提示-connection-拒绝" aria-label="Permalink to &quot;Vits 卡住，提示 Connection 拒绝&quot;">​</a></h3><p><img src="'+f+'" alt="1c3045c784d4bd9c1d2ffbe9070b01ae"></p><ul><li>打开 localhost:23456，随便生成一个语音。如果有错误提示：</li><li>使用梯子，确保网络环境通畅，首次生成语音会下载国外的东西。</li><li>如果网页能正常生成语音，则 lingchat 肯定也没问题</li><li>重启 lingchat，即可修复</li></ul><h3 id="提示-speaker-id-不存在" tabindex="-1">提示 speaker_id 不存在 <a class="header-anchor" href="#提示-speaker-id-不存在" aria-label="Permalink to &quot;提示 speaker_id 不存在&quot;">​</a></h3><p><img src="'+t+'" alt="375cec5632c886575ef240d06897302e"></p><ul><li>没有安装语言模型，把语音模型下载到 data/models/文件夹</li><li>如果使用的是其他 vits 模型，请人工设置 game_data/characters/人物名/settings.txt 里面的 speaker_id 的值，可以用 0 测试</li></ul><h3 id="mecab初始化失败" tabindex="-1">MeCab初始化失败 <a class="header-anchor" href="#mecab初始化失败" aria-label="Permalink to &quot;MeCab初始化失败&quot;">​</a></h3><p><img src="'+t+'" alt="2525ef209761d9662ef70c047feab802"></p><ul><li>Vits有中文路径导致的，不要包含任何中文路径</li></ul><h3 id="生成之后卡死-无报错提示" tabindex="-1">生成之后卡死，无报错提示 <a class="header-anchor" href="#生成之后卡死-无报错提示" aria-label="Permalink to &quot;生成之后卡死，无报错提示&quot;">​</a></h3><ul><li>经过测试，部分50系显卡会有这个问题，simple-vits-api似乎暂时不支持部分50系显卡，请使用BERT模型</li></ul><h2 id="style-bert-vits2-语音问题" tabindex="-1">Style Bert Vits2 语音问题 <a class="header-anchor" href="#style-bert-vits2-语音问题" aria-label="Permalink to &quot;Style Bert Vits2 语音问题&quot;">​</a></h2><blockquote><p>这个问题太多了，他们写的代码有很大的安装问题。请等待我们日后打包个简单版本</p></blockquote><h2 id="界面问题" tabindex="-1">界面问题 <a class="header-anchor" href="#界面问题" aria-label="Permalink to &quot;界面问题&quot;">​</a></h2><h3 id="界面一片空白没有人物" tabindex="-1">界面一片空白没有人物 <a class="header-anchor" href="#界面一片空白没有人物" aria-label="Permalink to &quot;界面一片空白没有人物&quot;">​</a></h3><p>程序加载较慢（尤其是打开rag时），只需等待片刻即可。</p><p>当然，如果等待时间过久，请汇报程序有问题</p>',37)),i(l),i(s)])}const y=r(m,[["render",q]]);export{C as __pageData,y as default};
